import React from "react";
import { Layout, Menu, Breadcrumb, Icon } from 'antd';
import {Link} from 'react-router-dom';



const { Header, Content, Footer, Sider } = Layout;
const { SubMenu } = Menu;


const links = [
  { route: "/"},
  { route: "/about"},
  { route: "/blog"},
  { route: "/contact"},
];

class LayoutAnt extends React.Component {

  state = {
    collapsed: false,
  };

  // constructor() {
  //   this.handleClickLink = this.handleClickLink.bind();
  // }

  onCollapse = collapsed => {
    console.log(collapsed);
    this.setState({ collapsed });
  };



  renderLink = () => {
    return links.map( link =>
      <Link key={link.route} to={link.route}>
          {link.label}
      </Link>
  )
}
  render() {
    return (
      <Layout style={{ minHeight: '100vh' }} >
          <Sider collapsible collapsed={this.state.collapsed} onCollapse={this.onCollapse}>
          <div className="logo" />
          <Menu theme="dark" defaultSelectedKeys={['1']} mode="inline">
          <Menu.Item key="1">
            <Icon type="pie-chart" />
            <span>Home</span>
          </Menu.Item>
          <Menu.Item history={this.history} key="2" 
          >
            <Icon type="team" />
            <span>Elenco </span>
            <Link 
            to="/elenco"
            ></Link>
          </Menu.Item>
          <SubMenu
            key="sub1"
            title={
              <span>
                <Icon type="layout" />
                <span>Temporada</span>
              </span>
            }
          > 
            <Menu.Item key="3">Campeonato 1</Menu.Item>
            <Menu.Item key="4">Campeonato 2 </Menu.Item>
            <Menu.Item key="5">Campeonato 3</Menu.Item>
          </SubMenu>
          <SubMenu
            key="sub2"
            title={
              <span>
                <Icon type="team" />
                <span>Finanças</span>
              </span>
            }
          >
            <Menu.Item key="6">Incrições</Menu.Item>
            <Menu.Item key="8">Jogos</Menu.Item>
          </SubMenu>
          <Menu.Item key="9">
            <Icon type="file" />
            <span>Fotos</span>
          </Menu.Item>
          </Menu>
      </Sider>   

      </Layout>
    );
  }
}

export default LayoutAnt;
